description:
Sams Teach Yourself Adobe Creative Suite All in One

Sams Teach Yourself Adobe Suite All in One has all the answers for beginning users of Adobe's graphics products in one big, easy to use book. It doesnt assume the reader wants to learn how to use just one product, but covers multiple products and technologies together in a logical, well-integrated fashion.
A compendium of multiple reference books in one volume, this book is designed for the user who wants to buy just one book that is likely to answer all his current and future questions on the most recent versions of: Adobe Photoshop, Adobe Illustrator, Adobe GoLive, Adobe Acrobat, and Adobe InDesign.

